import React, { useState } from "react";
import "../../../../public/calidad.css";
import DropL from "./Elementos/DropL";
import Upfile from "./Elementos/UploadFile";
import TETT from "./Elementos/DropListInfo";
import { Button } from "carbon-components-react";
import { FileUploaderDropContainer } from "carbon-components-react";
import { RadioButton } from "carbon-components-react";
import { ProgressIndicator } from "carbon-components-react";
import { ProgressStep } from "carbon-components-react";
import { Form } from "carbon-components-react";
import { TextInput } from "carbon-components-react";
import { TextArea } from "carbon-components-react";
import { Select } from "carbon-components-react";
import { SelectItem } from "carbon-components-react";
import { Tooltip } from "carbon-components-react";
import { DatePicker } from "carbon-components-react";
import { DatePickerInput } from "carbon-components-react";
import { Checkbox } from "carbon-components-react";

function Pruebas() {
  return (
    <div id="Pruebas" class="tabcontent" style={{ color: "blue" }}>
      <h1>Pruebas</h1>
      <hr />
      <Form>
        <Upfile />

        <div style={{ display: "flex", margin: "0 10px", width: "500px" }}>
          <DropL
            label={TETT[0].label}
            list={TETT[0].list}
            list2={TETT[0].list2}
            list3={TETT[0].list3}
          />
          <DropL
            label={TETT[0].label}
            list={TETT[0].list}
            list2={TETT[0].list2}
            list3={TETT[0].list3}
          />
          <DropL
            label={TETT[0].label}
            list={TETT[0].list}
            list2={TETT[0].list2}
            list3={TETT[0].list3}
          />
        </div>
        <br />
        <hr />
        <label style={{ fontSize: "16px", margin: "50px 0 0px 50px" }}>
          VPD Seagates
        </label>
        <TextArea
          style={{ margin: "25px 0 25px 25px" }}
          cols={40}
          helperText="Optional helper text here; if message is more than one line text should wrap (~100 character count maximum)"
          id="ComentariosTextArea"
          invalidText="Invalid error message."
          // labelText="Comentarios"
          placeholder="5u92,4u106,2u22e"
          rows={6}
        />
        <label style={{ fontSize: "16px", margin: "50px 0 0px 50px" }}>
          Comentarios T.
        </label>
        <TextArea
          style={{ margin: "25px 0 25px 25px" }}
          cols={40}
          helperText="Optional helper text here; if message is more than one line text should wrap (~100 character count maximum)"
          id="ComentariosTextArea"
          invalidText="Invalid error message."
          // labelText="Comentarios"
          placeholder="Comentarios."
          rows={6}
        />

        <Button kind="primary" tabIndex={0} type="submit">
          Guardar
        </Button>
      </Form>
    </div>
  );
}

export default Pruebas;
